We all have a night terror but we strongly belief it’s only in nightmare ,that night terrors are not real.
What then will you do ,when your own night terror is no more a dream?
 When your night terror becomes a reality.
when it’s no more a figment of your imagination. 
You live ,talk ,dine and sleep with your night terror.
 Then they say you are delusional, hallucinating or even call you a schizophrenic but deep down you know it’s not a fantasy ,that your soul is not in a kind of purgatory but you are battling with A LIVING GHOST .
You all need to see this movie ,it’s definitely not your regular kind . .
